@GeFazioBreakingNews 🇺🇸🇧🇷

DIRETRIZES DO GRUPO

Sejam todos muito bem-vindos(a)

ESSE GRUPO É UMA SALA DE AULA

1. O maior objetivo deste grupo, é formar uma militância bolsonarista no Brasil.

2. Grupo de apoio incondicional ao Presidente Jair Messias Bolsonaro;

3. Grupo a favor da criminalização do socialismo e do comunismo;

4. É expressamente proibido qualquer conteúdo de apologia ao nazismo, fascismo, socialismo,  e ao comunismo;

5. Este não é um grupo de debates sobre temas irrelevantes, fofocas de política, temas sensacionalistas. O grupo é voltado para os estudos  sobre política, a criminalização da esquerda comunista no Brasil, e sobre como podemos libertar O Nosso País dos inimigos que prejudicam ao Povo, e o desenvolvimento da Nação.

 6. Evitem postagens da chamada "DIREITA BURRA" (TERMO USASO PELO PRÓPRIO PRESIDENTE AOS QUE ATACAVAM E COBRAVAM AÇÕES DO GOVERNO)
Como também:
mídia terrorista comunista, desinformação, conteúdos fora do contexto das aulas do Professor, conteúdos especulativos,conteúdos repetidos.

7. Não é permitido postagens de violência explícita (gore), violência contra crianças, idosos, e animais;

8. Evitem qualquer discussão ou debates sobre temas religiosos, terraplanismo/terraesferismo, doutrinas em geral, e assuntos especulativos. Salvo quando forem temas relacionados com a História ou Geopolítica, etc;

9. Conteúdos de pedofilia serão automaticamente removidos e devidamente denunciados às autoridades competentes;

10. Proibido conteúdos obscenos e pornográficos;

11. Proibido links de venda de produtos ou promoções de afiliados;

12. Evitem discussões e xingamentos no grupo. Caso haja alguma desavença entre alguns membros, por favor resolvam no privado. (Salvo quando for um comunista/infiltrado. Estes merecem e devem ser escrachados);

12+1. Alunos que notarem algo que fere qualquer uma dessas regras, por gentileza, marque com @admin.  
Perguntas ao professor, marquem @Drmarcelofrazao

14. Denunciem os infiltrados pois aqueles que se omitem, interagem, ou aceitam comunistas no ambiente, podem ser confundidos como tais;

15. O descumprimento das diretrizes acarretarão desde advertência e silenciamento, até o banimento definitivo do grupo; 

16. Respeite os administradores e os outros membros. Todos estamos juntos em igualdade, aprendendo com o Dr Marcelo Frazão em sua Sala de Aula Pública;

